pub fn lexToken_q(modifyCache: bool) -> P<CToken> {
    /*do*/ {
        let pos = getPos;

        let inp = getInput;

        match alexScan((pos, inp), 0) {
            AlexEOF => {
                /*do*/ {
                    handleEofToken;
                    CTokEof
                }
            },
            AlexError(_inp) => {
                lexicalError
            },
            AlexSkip((pos_q, inp_q), _len) => {
                /*do*/ {
                    setPos(pos_q);
                    setInput(inp_q);
                    lexToken_q(modifyCache)
                }
            },
            AlexToken((pos_q, inp_q), len, action) => {
                /*do*/ {
                    setPos(pos_q);
                    setInput(inp_q);
                    let nextTok = action(pos, len, inp);

                    if modifyCache { setLastToken(nextTok) };
                    nextTok
                }
            },
        }
    }
}

pub fn lexC<a>(cont: fn(CToken) -> P<a>) -> P<a> {
    /*do*/ {
        let nextTok = lexToken;

        cont(nextTok)
    }
}

